import React from 'react';
import './App.css'; // You can keep this as is
import Header from './js_files/Header'; // Update to reflect new location
import LandingPage from './js_files/LandingPage';

function App() {
  return (
    <div className="App">
      <Header />
      <LandingPage />
    </div>
  );
}

export default App;
